" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Multiple metatarsal fractures after crush injury",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 290px; height: 468px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Multiple distal metatarsal shaft fractures are evident in this patient who suffered a severe crush injury (thin arrows). There is widening of the space between the first and second metatarsal. This is usually caused by a tarso-metatarsal fracture dislocation (Lisfranc injury), but in this case is due to fracture of the cuneiform (thick arrow).",
"    <div class=\"footnotes\">",
