var title_f0_33_539="Probability of pregnancy after unprotected intercourse";
var content_f0_33_539=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F58851&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F58851&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Probability of pregnancy after unprotected intercourse by timing of coitus",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_left\">",
"       3 days before ovulation",
"      </td>",
"      <td>",
"       15 percent",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_left\">",
"       1 or 2 days before ovulation",
"      </td>",
"      <td>",
"       30 percent",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_left\">",
"       day of ovulation",
"      </td>",
"      <td>",
"       12 percent",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_left\">",
"       1 or 2 days after ovulation",
"      </td>",
"      <td>",
"       near zero",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Trusell, J, et al. Contraception 1998; 57:363.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
